import React from 'react';

const CoursesPage = () => {
  return (
    <div className="container mx-auto px-6 py-12">
      <h1 className="text-4xl font-bold mb-4">Courses</h1>
      <p className="text-lg mb-6">List of all available courses.</p>
    </div>
  );
};

export default CoursesPage;
